pragma solidity ^0.8.0;

import "./MyToken.sol";
import "./SafeMath.sol";
import "hardhat/console.sol";
import "./LPTokenCurve.sol";

// import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

library Math {
    function abs(uint256 x, uint256 y) internal pure returns (uint256) {
        return x >= y ? x - y : y - x;
    }
}

contract CurveAMM {
    using SafeMath for uint; // 引入 SafeMath 库，用于处理整数运算

    address public token1; // 交易池中的第一个代币地址
    address public token2; // 交易池中的第二个代币地址
    LPTokenCurve public LPtokenCurve;
    uint public LPtotalSupply; // LP 代币的总供应量
    uint256 public reserve1;
    uint256 public reserve2;
    uint8 public constant N = 2;
    uint8 public constant A = 10;

    uint public product;

    mapping(address => uint) public LPbalanceOf; // 记录每个地址持有的 LP 代币数量

    event Mint(address indexed sender, uint amount1, uint amount2); // 添加流动性时触发的事件
    event Burn(
        address indexed sender,
        uint amount1,
        uint amount2,
        address indexed to
    ); // 提取流动性时触发的事件

    constructor(address _token1, address _token2) {
        token1 = _token1; // 初始化交易池中的第一个代币地址
        token2 = _token2; // 初始化交易池中的第二个代币地址
        LPtokenCurve = new LPTokenCurve("LPCurve Token", "LPCurve");
    }

    function getReserves() public view returns (uint256, uint256) {
        return (reserve1, reserve2);
    }

    function addLiquidity(
        uint256 _amount1,
        uint256 _amount2
    ) public /**onlyOwner */ {
        require(
            _amount1 >= 0 && _amount2 >= 0,
            "Amounts must be greater than 0"
        );
        require(
            _amount1 <= MyToken(token1).balanceOf(msg.sender) &&
                _amount2 <= MyToken(token2).balanceOf(msg.sender),
            "Amounts must be greater than your balance"
        );

        if (reserve1 == 0 && reserve2 == 0) {
            require(
                MyToken(token1).transferFrom(
                    msg.sender,
                    address(this),
                    _amount1
                ) &&
                    MyToken(token2).transferFrom(
                        msg.sender,
                        address(this),
                        _amount2
                    ),
                "Transfer failed"
            );
            reserve1 = _amount1;
            reserve2 = _amount2;
        } else {
            //在现有pool基础上继续加入新的liquidity
            //@TODO 这里还需要继续实现，包括之前在js中deploy后立刻addLiquidity，都要最好改成前端能够自己输入数量的形式。
            require(
                MyToken(token1).transferFrom(
                    msg.sender,
                    address(this),
                    _amount1
                ) &&
                    MyToken(token2).transferFrom(
                        msg.sender,
                        address(this),
                        _amount2
                    ),
                "Transfer failed"
            );

            reserve1 += _amount1;
            reserve2 += _amount2;
        }
        // product = SafeMath.mul(
        //     SafeMath.div(reserve1, 1000000000000000000),
        //     SafeMath.div(reserve2, 1000000000000000000)
        // );
        uint liquidity = calculateLiquidity(_amount1, _amount2); // 计算相应数量的 LP 代币
        require(liquidity > 0, "Invalid liquidity amount"); // 检查计算出的 LP 代币数量是否有效

        require(
            LPtokenCurve.mint(msg.sender, liquidity),
            "LPTokenCurve Mint false!"
        );
        emit Mint(msg.sender, _amount1, _amount2); // 触发添加流动性的事件

        // product = SafeMath.mul(reserve1, reserve2).div(1000000000000000000);
    }

    function _getY(
        uint256 i,
        uint256 j,
        uint256 x,
        uint256[N] memory xp
    ) private pure returns (uint256) {
        /*
        Newton's method to compute y
        -----------------------------
        y = x_j
        f(y) = y^2 + y(b - D) - c
                    y_n^2 + c
        y_(n+1) = --------------
                   2y_n + b - D
        where
        s = sum(x_k), k != j
        p = prod(x_k), k != j
        b = s + D / (An^n)
        c = D^(n + 1) / (n^n * p * An^n)
        */
        uint256 a = A * N;
        uint256 d = _getD(xp);
        uint256 s;
        uint256 c = d;

        uint256 _x;
        for (uint256 k; k < N; ++k) {
            if (k == i) {
                _x = x;
            } else if (k == j) {
                continue;
            } else {
                _x = xp[k];
            }

            s += _x;
            c = (c * d) / (N * _x);
        }
        c = (c * d) / (N * a);
        uint256 b = s + d / a;

        // Newton's method
        uint256 y_prev;
        // Initial guess, y <= d
        uint256 y = d;
        for (uint256 _i; _i < 255; ++_i) {
            y_prev = y;
            y = (y * y + c) / (2 * y + b - d);
            if (Math.abs(y, y_prev) <= 1) {
                return y;
            }
        }
        revert("y didn't converge");
    }

    function _getD(uint256[N] memory xp) private pure returns (uint256) {
        uint256 S;
        for (uint256 i = 0; i < N; i++) {
            S += xp[i];
        }
        if (S == 0) {
            return 0;
        }

        uint256 Dprev = 0;
        uint256 D = S;
        uint256 Ann = A * N;
        for (uint256 i = 0; i < 255; i++) {
            uint256 D_P = D;
            for (uint256 j = 0; j < N; j++) {
                D_P = (D_P * D) / (xp[j] * N + 1); // +1 是为了防止出现除以 0 的情况
            }
            Dprev = D;
            D =
                (((Ann * S) + (D_P * N)) * D) /
                (((Ann - 1) * D) + ((N + 1) * D_P));
            // 保留 1 的精度
            if (D > Dprev) {
                if (D - Dprev <= 1) {
                    break;
                }
            } else {
                if (Dprev - D <= 1) {
                    break;
                }
            }
        }
        return D;
    }

    function getExchangeRate(
        address fromToken,
        address toToken,
        uint256 amount
    ) public view returns (uint256) {
        // 该函数首先判断输入的代币是否合法，然后根据当前的资产池余额和输入的数量计算出当前的汇率。
        // 其中，curveFunction 函数用于计算 Curve-like AMM 模型中的价格曲线。最后，将计算结果返回给调用者。
        uint256 fromReserve;
        uint256 toReserve;
        uint256[N] memory xp;
        if (fromToken == token1 && toToken == token2) {
            xp[0] = reserve1;
            xp[1] = reserve2;
            fromReserve = reserve1;
            toReserve = reserve2;
        } else if (fromToken == token2 && toToken == token1) {
            xp[0] = reserve2;
            xp[1] = reserve1;
            fromReserve = reserve2;
            toReserve = reserve1;
        } else {
            revert("Invalid tokens");
        }

        // x = previous x balance + the amount user deposited
        uint256 x = xp[0] + amount;

        uint256 y0 = xp[1]; //current balance of j
        uint256 y1 = _getY(0, 1, x, xp); //use the algorithm to calculate the y the new y reserves

        uint256 result = (y0 - y1); // -1 to round it down

        // uint result = toReserve.sub(
        //     (product.mul(10 ** 18)).div((fromReserve.add(amount)))
        // );

        return result;
    }

    // function removeLiquidity(uint256 _amount) public {
    //     require(_amount > 0, "Amount must be greater than 0");
    //     uint256 totalSupply = MyToken(msg.sender).balanceOf(address(this));
    //     uint256 amount1 = (_amount * reserve1) / totalSupply;
    //     uint256 amount2 = (_amount * reserve2) / totalSupply;
    //     require(
