    //             MyToken(token2).transfer(msg.sender, amount2),
    //         "Transfer failed"
    //     );
    //     reserve1 -= amount1;
    //     reserve2 -= amount2;
    // }

    function swap(
        address _from,
        address _to,
        uint256 _fromAmount,
        uint256 _toAmount
    ) public {
        require(_from != _to, "Same tokens");
        require(
            _fromAmount > 0 && _toAmount > 0,
            "Amounts must be greater than 0"
        );

        uint256 amountIn;
        uint256 amountOut;
        amountIn = _fromAmount;
        amountOut = _toAmount;

        // uint256 amount2 = curveFunction(reserve1 + amountIn) - reserve2;

        console.log("MyToken(_to).approve(msg.sender, amountOut)");
        require(
            MyToken(_from).transferFrom(msg.sender, address(this), amountIn),
            "Transfer failed"
        );
        console.log(
            "MyToken(_from).transferFrom(msg.sender, address(this), amountIn) failed"
        );

        require(
            MyToken(_to).transfer(msg.sender, amountOut),
            "Transfer failed"
        );
        console.log(
            "MyToken(_to).transferFrom(address(this), msg.sender, amountOut) failed"
        );

        if (_from == token1 && _to == token2) {
            reserve1 += amountIn;
            reserve2 -= amountOut;
        } else {
            reserve2 += amountIn;
            reserve1 -= amountOut;
        }
    }

    function curveFunction(uint256 x) private pure returns (uint256) {
        return (x * x) / (x + 1);
    }

    // function mint(uint amount1, uint amount2) internal {
    //     //@TODO 是否一种币也能存
    //     require(amount1 > 0 && amount2 > 0, "Insufficient liquidity"); // 检查提供的资产数量是否足够
    //     uint liquidity = calculateLiquidity(amount1, amount2); // 计算相应数量的 LP 代币
    //     require(liquidity > 0, "Invalid liquidity amount"); // 检查计算出的 LP 代币数量是否有效
    //     //addLiquidity()
    //     LPbalanceOf[msg.sender] = LPbalanceOf[msg.sender].add(liquidity); // 增加流动性提供者在交易池中持有的 LP 代币数量
    //     LPtotalSupply = LPtotalSupply.add(liquidity); // 增加 LP 代币的总供应量
    //     emit Mint(msg.sender, amount1, amount2); // 触发添加流动性的事件
    // }

    function removeLiquidity(uint256 amount) external {
        uint liquidity = LPtokenCurve.balanceOf(msg.sender); // 获取流动性提供者在交易池中持有的 LP 代币数量
        require(liquidity >= amount, "Insufficient liquidity"); // 检查 LP 代币数量是否足够
        uint amount1 = calculateTokenAmount(amount, token1); // 计算流动性提供者可以提取的第一个代币数量
        uint amount2 = calculateTokenAmount(amount, token2); // 计算流动性提供者可以提取的第二个代币数量
        require(amount1 > 0 && amount2 > 0, "Invalid token amount"); // 检查计算出的代币数量是否有效

        LPtokenCurve.burn(msg.sender, amount);
        // LPbalanceOf[msg.sender] = 0; // 减少流动性提供者在交易池中持有的 LP 代币数量
        // LPtotalSupply = LPtotalSupply.sub(amount); // 减少 LP 代币的总供应量
        MyToken(token1).transfer(msg.sender, amount1); // 将流动性提供者可以提取的第一个代币转移至指定地址
        MyToken(token2).transfer(msg.sender, amount2); // 将流动性提供者可以提取的第二个代币转移至指定地址
        reserve1 -= amount1;
        reserve2 -= amount2;
        emit Burn(msg.sender, amount1, amount2, msg.sender); // 触发提取流动性的事件
    }

    function sqrt(uint256 y) public pure returns (uint256) {
        //在使用该函数时，传入的参数y必须已经按照以太坊计数标准进行换算，即小数点后有18位数字
        uint256 z = y.mul(10 ** 18).add(1).div(2);
        uint256 w = y.mul(10 ** 18);
        while (z < w) {
            w = z;
            z = y.mul(10 ** 18).div(z).add(z).div(2);
        }
        return w;
    }

    function calculateLiquidity(
        uint amount1,
        uint amount2
    ) public view returns (uint) {
        uint balance1 = MyToken(token1).balanceOf(address(this)); // 获取交易池中的第一个代币余额
        uint balance2 = MyToken(token2).balanceOf(address(this)); // 获取交易池中的第二个代币余额
        uint liquidity; // 初始化 LP 代币数量

        if (LPtokenCurve.totalSupply() == 0) {
            // 如果交易池中还没有 LP 代币，则直接按照提供的代币数量计算 LP 代币数量
            liquidity = sqrt(amount1.mul(amount2).div(10 ** 18));
        } else {
            // 否则按照当前交易池中的代币余额和 LP 代币数量计算新添加的 LP 代币数量
            uint amountRatio = (amount1.mul(1e18).div(balance1)) <
                (amount2.mul(1e18).div(balance2))
                ? (amount1.mul(1e18).div(balance1))
                : (amount2.mul(1e18).div(balance2)); // 计算提供的代币数量的比例。amountRatio = min(amount1 / balance1, amount2 / balance2) * 1e18
            liquidity = amountRatio.mul(LPtokenCurve.totalSupply()).div(1e18); // 计算新添加的 LP 代币数量。liquidity = amountRatio * LPtotalSupply / 1e18
        }
        return liquidity; // 返回计算出的 LP 代币数量
    }

    function calculateTokenAmount(
        uint liquidity,
        address token
    ) public view returns (uint) {
        require(token == token1 || token == token2, "Invalid token address"); // 检查代币地址是否有效
        if (liquidity == 0) {
            // 如果 LP 代币数量为 0，则提取的代币数量也为 0
            return 0;
        }
        uint balance = MyToken(token).balanceOf(address(this)); // 获取交易池中指定代币的余额
        return liquidity.mul(balance).div(LPtokenCurve.totalSupply()); // 计算流动性提供者可以提取的代币数量
    }

    function getLPTokenAddress() public view returns (address) {
        return address(LPtokenCurve);
    }
}
